function Landing() {

    return (
      <div id='landing'>
        <div id='landing-content'>

            <p id='welcome-txt'>Welcome to</p>
            <div className="fit">
              <h1 id='title'>EVERWIN Global Express Co.</h1>
              <div id='identity-div'>
                <p id='identity-txt'>Logistician | Consultant | Technician | Solution Maker</p>
              </div>
            <button>Get in Touch</button>
          </div>
        </div>
      </div>
    );
  }

export default Landing;
